import React from 'react';
import { Container, Row, Navbar, Button, Col } from 'react-bootstrap';
function Header() {
  return (
    <Navbar bg="dark" variant="dark" sticky="top" className="d-flex justify-content-center">
      <Container>
        <Row>
          <Col>
            <Button variant="outline-info">Top!</Button>
          </Col>

          <Col>
            <Navbar.Brand href="#home">Incli</Navbar.Brand>
          </Col>
        </Row>
      </Container>
    </Navbar>
  );
}

export default Header;
